import React from 'react'

const Dashboard = ({cps}) => {
    return (
        <div>
            <center><h1>Charging Point Management</h1></center>
            {cps && cps.map((cp) => (
                <div className="card" key={cp.id}>
                    <div className="card-body">
                        <div className="card-title">ID: {cp.id}</div>
                        <div className="card-title">Port: {cp.occupied}</div>
                        <div className="card-title">Repo: {cp.power}</div>
                        <div className="card-title">Created Date: { Date(cp.connectedTime)}</div>
                    </div>
                </div>
            ))}
        </div>
    )
};

export default Dashboard
